        return True
    if (guess % 2 == 0):
        return False
    ul = round(guess**0.5) + 1
    for factor in range(3, ul,2):
        if (guess % factor == 0):
            return False
    return True


def PowerfulNumber(n):
    flag = 1
    if n > 1:
        flag = 0
        for p in range(2, n + 1):
            if isPrime(p):
                if n % p == 0:
                    flag = 1
                    if n % p**2 != 0:
                        return False

    if flag:                
        return True
    else:
        return False

def nthPowerfulNumber(n):
    found = 0
